                        "title_line_2": "#FreeFortnite",
                        "title_line_1": "Coupe",
                        "background_title": "TOURNOI SOLO",
                        "shadow_color": "000000",
                        "details_description": "Dans quelques jours, la communauté Fortnite ne pourra plus s'affronter jusqu'à la victoire en multiplateforme. Apple a bloqué Fortnite sur l'App Store, ce qui signifie qu'après le lancement du Chapitre 2 - Saison 4, le 27 août, les joueurs sur iPhone et iPad ne pourront plus jouer ensemble. Les joueurs ayant obtenu les meilleurs scores dans toutes les régions recevront la tenue Trognon grognon, et les meilleurs d'entre eux recevront également un couvre-chef ajustable #FreeFortnite. De plus, si vous faites partie des 10 joueurs ayant mangé le plus de pommes en une seule partie ou des 10 joueurs ayant mangé le plus de pommes durant tout le tournoi dans votre région, vous gagnez encore plus de prix ! Plus de détails et règlement officiel disponibles sur fn.gg/FreeFortniteCup. REMARQUE : le texte de score de la Victoire royale ci-dessous est sujet à un léger bug. Les Victoires royales rapportent 10 points. Toutes les 3 minutes passées dans la partie, vous recevez 1 point.",
